import './login.css';
import { useNavigate } from 'react-router-dom'
import React, { useState, useEffect } from 'react';
import { Container } from 'react-bootstrap';

function Login() {
    const [name, setName] = useState("");

    let [age, setAge] = useState("");
    let userNameWarn = "username", userPasswordWarn = "userpassword";
    const navigate = useNavigate();
    useEffect(() => {
        const auth = "";
        // const auth = {"name":"jaysing"};
        if (auth) {
            navigate("/");
        }
    });
    const checkInput = () => {
        userNameWarn = "Please Enter Username";
    };
    return (
        <div>
        <Container className='formContainer'>

            <input className='formInput' onChange={(e) => setName(e.target.value)} type="text" placeholder='Enter Username'></input>
            <span className='formWarn'>{userNameWarn}</span>
            <input className='formInput' type="text" placeholder='Enter Username'></input>
            <span className='formWarn'>{userPasswordWarn}</span>
            <button type="button" onClick={checkInput}>Login</button>
        </Container>
        <button>click me</button>
        </div>
    );

}

export default Login;
